// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20BurnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/extensions/ERC20SnapshotUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./IAdmin.sol";

contract Basket is
    Initializable,
    ERC20Upgradeable,
    ERC20BurnableUpgradeable,
    ERC20PausableUpgradeable
{
    string public basketName;
    string public basketSymbol;
    address public adminsOperationAddress;
    string public basketMetaData;
    address public contractOwner;

    event MetadataUpdated(string indexed metadata);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor(
        string memory _basketName,
        string memory _basketsymbol,
        string memory _basketMetaData,
        address _adminOperationsAddress,
        address _owner
    ) {
        basketName = _basketName;
        basketSymbol = _basketsymbol;
        basketMetaData = _basketMetaData;
        adminsOperationAddress = _adminOperationsAddress;
        contractOwner = _owner;
        initialize();
        _disableInitializers();
    }

    modifier onlyOwner() {
        require(
            msg.sender == contractOwner,
            "Only the contract owner can call this function"
        );
        _;
    }

    function initialize() public initializer {
        __ERC20_init(basketName, basketSymbol);
        __ERC20Burnable_init();
        __ERC20Pausable_init();
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function decimals() public pure override returns (uint8) {
        return 6;
    }

    function mint(address to, uint256 amount) public onlyOwner {
        IAdmin Admin = IAdmin(adminsOperationAddress);
        require(!Admin.isBlackListed(to), "Account is BlackListed");
        _mint(to, amount);
    }

    function burn(address account, uint256 amount) public onlyOwner {
        _burn(account, amount);
    }

    function transfer(
        address _to,
        uint256 _value
    ) public override returns (bool) {
        IAdmin Admin = IAdmin(adminsOperationAddress);
        require(
            !Admin.isBlackListed(msg.sender),
            "Sender Account is BlackListed"
        );
        require(!Admin.isBlackListed(_to), "Account is BlackListed");

        _transfer(_msgSender(), _to, _value);

        return true;
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _value
    ) public override returns (bool) {
        IAdmin Admin = IAdmin(adminsOperationAddress);
        require(
            !Admin.isBlackListed(msg.sender),
            "Transaction Signatory Account is BlackListed"
        );
        require(
            !Admin.isBlackListed(_from),
            "Sender Account is BlackListed"
        );
        require(!Admin.isBlackListed(_to), "Account is BlackListed");

        address spender = _msgSender();
        _spendAllowance(_from, spender, _value);
        _transfer(_from, _to, _value);
        return true;
    }

    function updateBasketMetadata(string memory _newMetadata) public onlyOwner {
        basketMetaData = _newMetadata;
        emit MetadataUpdated(_newMetadata);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    )
        internal
        override(ERC20Upgradeable, ERC20PausableUpgradeable)
        whenNotPaused
    {
        super._beforeTokenTransfer(from, to, amount);
    }
}

