contracts/BasketFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./Basket.sol";

contract BasketFactory is Initializable, OwnableUpgradeable {
    address[] public deployedBaskets;
    address public adminOperationsAddr;

    event BasketDeployed(address indexed basketAddress, address indexed owner);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor (address newadminOperationsAdd) {
        adminOperationsAddr = newadminOperationsAdd;
        _disableInitializers();
    }

    function initialize() initializer public {
        __Ownable_init();
    }

    function createBasket(
        string memory name, 
        string memory symbol, 
        string memory basketMetaData, 
        address adminOperationsAddress
        ) public {
        Basket newBasket = new Basket(name, symbol, basketMetaData, adminOperationsAddress, msg.sender);
        deployedBaskets.push(address(newBasket));
        emit BasketDeployed(address(newBasket), msg.sender);
    }

    function getDeployedBaskets() public view returns (address[] memory) {
        return deployedBaskets;
    }
}

