// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/IERC20Metadata.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./IVault.sol";

contract MoojaEscrow {

    address public basketContractAddress;
    address public contractOwner;

    constructor (address _basketContractAddress, address _owner) {
        contractOwner = _owner;
        basketContractAddress =  _basketContractAddress;
    }

        modifier onlyOwner() {
        require(
            msg.sender == contractOwner,
            "Only the contract owner can call this function"
        );
        _;
    }

    mapping(address => mapping(address => uint256)) public userBaseCurrencyAllowance;

    event adminPullBaseCurrency(address indexed userAddress, address indexed tokenAddress, uint256 indexed amount);
    event adminWithdrawBaseCurrency(address indexed receiver, uint256 indexed amount, address indexed tokenAddress);
    event settleTrade(
        address buyerAddress, 
        uint256 indexed buyerAmount, 
        address indexed sellerAddress, 
        uint256 indexed sellerAmount, 
        address quoteCurrencyAddress,
        address baseCurrencyAddress
        );

    function AdminPullBaseCurrency(address userAddress, address tokenAddress, uint256 amount) public onlyOwner {
        IERC20 token = IERC20(tokenAddress);
        require(token.allowance(userAddress, address(this)) >= amount, "Allowance not enough");
        require(token.transferFrom(userAddress, address(this), amount), "Transfer failed");
        userBaseCurrencyAllowance[userAddress][tokenAddress] = amount;
        emit adminPullBaseCurrency(userAddress, tokenAddress, amount);
    }

    function AdminWithdrawBaseCurrency(address receiver, uint256 amount, address tokenAddress) onlyOwner public {
        require(userBaseCurrencyAllowance[receiver][tokenAddress] > 0, "User has not authorized");
        require(userBaseCurrencyAllowance[receiver][tokenAddress] >= amount, "User has not authorized enough amount");
        IERC20 token = IERC20(tokenAddress);
        userBaseCurrencyAllowance[receiver][tokenAddress] -= amount;
        require(token.transfer(receiver, amount), "Transfer failed");
        emit adminWithdrawBaseCurrency(receiver, amount, tokenAddress);
    }

    function SettleTrade (
        address buyerAddress, 
        uint256 buyerAmount, 
        address sellerAddress, 
        uint256 sellerAmount, 
        address quoteCurrencyAddress, 
        address baseCurrencyAddress,
        address vaultAddress
        ) onlyOwner public {
        IQuoteCurrencyVault Vault = IQuoteCurrencyVault(vaultAddress);
        require (Vault.userAllowance(buyerAddress, quoteCurrencyAddress) >= buyerAmount, "Buyer doesnt have enough funds to setlle trade");
        require(userBaseCurrencyAllowance[sellerAddress][baseCurrencyAddress] >= sellerAmount, "Seller does not have enough assets to setlle trade");
        Vault.AdminWithdrawQuoteCurrency(sellerAddress, buyerAmount, quoteCurrencyAddress);
        userBaseCurrencyAllowance[sellerAddress][baseCurrencyAddress] -= sellerAmount;
        IERC20(basketContractAddress).transfer(buyerAddress, sellerAmount);

        emit settleTrade(buyerAddress, buyerAmount, sellerAddress, sellerAmount, quoteCurrencyAddress, baseCurrencyAddress);
    }

    function getUserAddressBalance (address userAddress, address tokenAddress) public view returns (uint256) {
        return userBaseCurrencyAllowance[userAddress][tokenAddress];
    }
}

