// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "./Escrow.sol";

contract EscrowFactory is Initializable, OwnableUpgradeable {
    address[] public deployedEscrows;

    event EscrowDeployed(address indexed basketAddress, address indexed owner);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor () {
        _disableInitializers(); 
    }

    function initialize() initializer public {
        __Ownable_init();
    }

    function createEscrow(address basketContractAddress) public {
        MoojaEscrow newEscrow = new MoojaEscrow(basketContractAddress, msg.sender);
        deployedEscrows.push(address(newEscrow));
        emit EscrowDeployed(address(newEscrow), msg.sender);
    }

    function getDeployedEscrow() public view returns (address[] memory) {
        return deployedEscrows;
    }
}

